    return (
        <div id='education'>
            <h2 className='BLACKOUT'>education</h2>
            <div style={{width: "50vw"}}>
                <p>
                    I am currently studying my third year at the <Link className="green" to="https://www.umu.se/utbildning/program/civilingenjorsprogrammet-i-interaktion-och-design/" target="_blank" rel="noopener noreferrer">Master of Science Program in Interaction Technology and Design</Link> at Ume√• University.
                </p>
                <p>
                    The program makes me an expert in developing user-friendly, 
                    effective, and durable user interfaces. This includes giving me great skills in <span className='blue'>web development</span>, <span className='pink'>graphic design</span>, <span className='green'>end-user testing</span>, and <span className='blue'>software development</span>.
                </p>
            </div>

        </div>
    );
}

export default Education;
